  Susan b, at Gisborne and m. at Holy Trinity Church, Gisborne. Charles, s/o John Dowding and Shirley
  Appleton, b. at Gisborne. Address: "Rangatira", PO Box 20, Te Karaka, Gisborne.
  Susan was educated at Ruatoria then at Woodford House, where she excelled at art. After working at
  Westpac Bank, she gained a DipHort at Massey University, then worked in nurseries in Feilding,
  Hawkes Bay and Gisborne.
  Charles was educated at Hereworth School, Wanganui Collegiate and Lincoln College. He returned to
  run his father's farm at Te Karaka where he and Susan now run the Rangatira Angus Stud in
  partnership.
